k repository relationship data object','a','fedoraadmin',1222448929411,1261503234390,1261502794718,' dark repository relationship data object .',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,' ir:dark_repository .',NULL,NULL,NULL,NULL,NULL),('ir:MANUAL_APPROVAL','manual approval relationship data object','a','fedoraadmin',1222449031161,1261503304359,1261502948171,' manual approval relationship data object .',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,' ir:manual_approval .',NULL,NULL,NULL,NULL,NULL),('uuid:5500b5bf-970d-4178-a854-e1952f6094ef','structural engineering reports','a','pcharoen,admin',1224631939827,1314128396075,1312998059895,' structural engineering reports .',' piyapong charoenwattana .',NULL,'  .',NULL,NULL,NULL,NULL,NULL,' uuid:5500b5bf-970d-4178-a854-e1952f6094ef http://hdl.handle.net/10402/121.era.1022 .',NULL,NULL,NULL,NULL,NULL),('uuid:5542efa8-686c-4b15-b285-f0c91c08ab63','pedometer information sheet','a','admin',1222468580210,1244588235924,1222468583835,' pedometer information sheet .',NULL,' pedometers walking physical activity active living .',NULL,' alberta centre for active living .',NULL,' 2007 .',' article .',' adobe pdf .',' uuid:5542efa8-686c-4b15-b285-f0c91c08ab63 .',NULL,' en .',NULL,NULL,NULL),('uuid:5a6f7321-4752-44c2-94ea-47b41cb6d7e9','alberta centre for active living','a','pcharoen',1222457789177,1353536440386,1341873441703,' alberta centre for active living .',' piyapong charoenwattana .',NULL,' <a href=\"http://www.centre4activeliving.ca/index.html\">the alberta centre for active living</a> is a key advocate of physical activity and physical activity expertise and a primary source of research and education on physical activity for practitioners, organizations and decision-makers. the centre\'s mandate is to improve the health and quality of life for all people through physical activity. .',NULL,NULL,NULL,NULL,NULL,' uuid:5a6f7321-4752-44c2-94ea-47b41cb6d7e9 http://hdl.handle.net/10402/121.era.1032 .',NULL,NULL,NULL,NULL,NULL),('uuid:5c604802-9cd8-415d-a703-e5e1d6982da4','campus saint-jean','a','admin',1222468857028,1302796130657,1279208184164,' campus saint-jean .',' administrator demo .',NULL,' campus saint-jean is the only french-language university-degree program west of manitoba. the saint-jean school was founded in pincher creek in 1908 by an oblate priest as a juniorate, a place to instruct junior members preparing for life in the oblate order. three years later, the school moved to its current location overlooking the mill creek ravine, 6 kilometres east of the university of alberta\'s main campus. in the 1960s and 1970s, the collge saint-jean grew more affiliated with the university of alberta, and, in 1976, the oblate priests officially sold it to the university. in 1977, the collge changed its name to facult saint-jean and became a full faculty at the university of alberta. in october 2005, saint-jean was renamed campus saint-jean. .',NULL,NULL,NULL,NULL,NULL,' uuid:5c604802-9cd8-415d-a703-e5e1d6982da4 .',NULL,NULL,NULL,NULL,NULL),('uuid:936bc83d-2e75-4957-8c28-46dbc4808840','alberta surveys on physical activity','a','pcharoen',1222458191267,1328307846124,1315606889938,' alberta surveys on physical activity .',' piyapong charoenwattana .',NULL,' the alberta centre for active living has conducted the alberta survey of physical activity every other year for almost a decade to monitor the physical activity levels of albertans. this alberta series is part of the centres strategy of providing credible and user-friendly physical activity information to researchers, practitioners, and communities. all of the centres surveys are available on the <a href=\"http://www.centre4activeliving.ca/publications/surveys.html\">alberta centre for active living</a> web site. .',NULL,NULL,NULL,NULL,NULL,' uuid:936bc83d-2e75-4957-8c28-46dbc4808840 http://hdl.handle.net/10402/121.era.147 .',NULL,NULL,NULL,NULL,NULL),('uuid:a008afd9-55fb-4c3d-8b21-e2ab958cac56','civil and environmental engineering','a','pcharoen',1224631873547,1302796135221,1233005056436,' civil and environmental engineering .',' piyapong charoenwattana .',NULL,' welcome to the department of civil & environmental engineering!\n\nour department is one of the largest civil engineering departments in canada and is also home to the school of mining and petroleum engineering.  civil engineering has been identified as one of the top careers choices, not only for its scope of interest, but also for its current and future demand in the job marketplace.\n\nthe future engineers of tomorrow are hard at work learning the latest in innovation and technology, with professors and researchers that are among the best in their fields. .',NULL,NULL,NULL,NULL,NULL,' uuid:a008afd9-55fb-4c3d-8b21-e2ab958cac56 .',NULL,NULL,NULL,NULL,NULL),('uuid:a0b94aeb-575a-474b-bb0d-0611cd8a52a1','projets de recherche et synthse / collection - 2007','a','pcharoen',1222469438217,1293129296801,1267738627093,' projets de recherche et synthse / collection - 2007 .',' piyapong charoenwattana .',NULL,'  .',NULL,NULL,NULL,NULL,NULL,' uuid:a0b94aeb-575a-474b-bb0d-0611cd8a52a1 .',NULL,NULL,NULL,NULL,NULL),('uuid:a7ee0083-34ed-4d02-9c4c-c9f5a6c845ef','activits culturelles en mathmatiques  llmentaire','a','admin',1222469371663,1341870989458,1222472085284,' activits culturelles en mathmatiques  llmentaire .',' lajeunesse, donna .',' mathmatiques culture ethnomathmatiques lmentaire .',' activit de synthse soumise  la faculty of graduate studies and research en vue de lobtention du diplme de matrise en sciences de lducation  tudes en langue et culture. nous voyons de plus en plus dimmigrants sinstaller au canada, venant de pays partout au monde, amenant avec eux des ides, des traditions, des langues et des cultures varies. les recherches dans le domaine dethnomathmatiques nous dmontre le lien entre la culture et les mathmatiques et comment cela peut motiver les jeunes lves de vouloir apprendre plus en mathmatiques. cette recherche nous prsente les ides ethnomathmatiques ainsi que plusieurs activits qui explorent les diverses aspects culturels des lves et de leurs parents : lhistorique, le traditionnelle ainsi que leur culture quotidienne. ces activits sont prpares afin de motiver les jeunes  dcouvrir les diffrentes faons que les gens faisaient les mathmatiques et dvelopperont le got dexplorer dautres activits en mathmatiques. .',NULL,NULL,NULL,' article .',NULL,' uuid:a7ee0083-34ed-4d02-9c4c-c9f5a6c845ef .',NULL,' fr .',NULL,NULL,NULL),('uuid:bd35b0ed-3c34-4db5-895d-b235a61afba3','electronic theses ... (old)','a','pcharoen',1224877803553,1297881554240,1297881530925,' electronic theses ... (old) .',' piyapong charoenwattana .',NULL,' this collection contains electronic theses and dissertations from university of alberta graduate students. .',NULL,NULL,NULL,NULL,NULL,' uuid:bd35b0ed-3c34-4db5-895d-b235a61afba3 http://hdl.handle.net/10402/121.1120 .',NULL,NULL,NULL,NULL,NULL),('uuid:cc2db889-bfa6-47c1-be14-cb1f99e06a6a','faculty of graduate studies ... (old)','a','pcharoen',1224877724559,1405007660784,1405007658638,' faculty of graduate studies ... (old) .',' piyapong charoenwattana .',NULL,' the university of alberta\'s faculty of graduate studies and research is guided by a tradition of scholarship that has attracted leading thinkers and researchers from around the world.\n\nmore than 5,600 graduate students participate in this dynamic learning environment each year through our extensive selection of research-oriented and professional programs.\n\nthe collections within this community represent the efforts of the university\'s graduate student community, primarily theses and dissertations. .',NULL,NULL,NULL,NULL,NULL,' uuid:cc2db889-bfa6-47c1-be14-cb1f99e06a6a http://hdl.handle.net/10402/143.era.1121 .',NULL,NULL,NULL,NULL,NULL),('uuid:fb2109b1-d8e5-456b-a694-1227495dba7f','fact sheets','a','admin',1233332091927,1293129293945,1268859841250,' fact sheets .',' administrator demo .',NULL,' the alberta centre for active l