INSERT INTO `t5` VALUES ('<info:fedora/uuid:a7ee0083-34ed-4d02-9c4c-c9f5a6c845ef>','\"Nous voyons de plus en plus d\\u2019immigrants s\\u2019installer au Canada, venant de pays partout au monde, amenant avec eux des id\\u00E9es, des traditions, des langues et des cultures vari\\u00E9es. Les recherches dans le domaine d\\u2019ethnomath\\u00E9mati'),('<info:fedora/uuid:a0b94aeb-575a-474b-bb0d-0611cd8a52a1>','\"\"'),('<info:fedora/uuid:fb2109b1-d8e5-456b-a694-1227495dba7f>','\"The Alberta Centre for Active Living has produced many fact sheets on various aspects of physical activity, including the benefits of physical activity for older adults, a pedometer information sheet, and ways to bring physical activity into your daily li'),('<info:fedora/uuid:8c30d60c-5ffb-41a3-bd31-fee9429baa9d>','\"The University of Alberta School of Business is one of the top business schools in Canada in terms of research, teaching and community involvement. We rank in the top three Canadian business faculties in research and in some departments in the top 50 in N'),('<info:fedora/uuid:98a4ef53-6d0d-4a7b-8e23-18a2453693c1>','\"Research Update profiles current research on physical activity from the Alberta Centre for Active Living and current research from other health-promotion organizations. All Research Update issues are available are available on the <a href=\\\"http://www.cen'),('<info:fedora/uuid:586d86d6-ae0e-4357-ae56-e51a3e528668>','\"\"'),('<info:fedora/uuid:a008afd9-55fb-4c3d-8b21-e2ab958cac56>','\"Welcome to the Department of Civil & Environmental Engineering!\\n\\nOur Department is one of the largest Civil Engineering departments in Canada and is also home to the School of Mining and Petroleum Engineering.  Civil Engineering has been identified as o'),('<info:fedora/uuid:a7ee0083-34ed-4d02-9c4c-c9f5a6c845ef>','\"Activit\\u00E9 de synth\\u00E8se soumise \\u00E0 la Faculty of Graduate Studies and Research en vue de l\\u2019obtention du dipl\\u00F4me de Ma\\u00EEtrise en sciences de l\\u2019\\u00E9ducation \\u2013 \\u00E9tudes en langue et culture.\"'),('<info:fedora/uuid:bd35b0ed-3c34-4db5-895d-b235a61afba3>','\"This collection contains electronic theses and dissertations from University of Alberta graduate students.\"'),('<info:fedora/uuid:a01d6785-3eab-4abc-9d72-dd89dcfd9740>','\"WellSpring, the Alberta Centre for Active Living\\u2019s publication for practitioners, provides information on best practices, topical issues, recent research, and policy in the active living/physical activity field. All WellSpring issues are available ar'),('<info:fedora/uuid:936bc83d-2e75-4957-8c28-46dbc4808840>','\"The Alberta Centre for Active Living has conducted the Alberta Survey of Physical Activity every other year for almost a decade to monitor the physical activity levels of Albertans. This Alberta series is part of the centre\\u2019s strategy of providing cr'),('<info:fedora/uuid:afb1b694-9802-4817-ad2a-71071aa1cff3>','\"The Alberta Centre for Active Living has published many research reports on various aspects of physical activity, e.g., physical activity and older adults and activity in the workplace. All of the centre\\u2019s research reports are available are available'),('<info:fedora/uuid:b422070f-1b96-4440-a12a-e4cf2e25512f>','\"Activit\\u00E9 de synth\\u00E8se soumise \\u00E0 la Faculty of Graduate Studies and Research en vue de l\'obtention du dipl\\u00F4me de Ma\\u00EEtrise en sciences de l\'\\u00E9ducation - \\u00E9tudes en langue et culture.\"'),('<info:fedora/uuid:5500b5bf-970d-4178-a854-e1952f6094ef>','\"\"'),('<info:fedora/uuid:b422070f-1b96-4440-a12a-e4cf2e25512f>','\"Le but de cette recherche \\u00E9tait de d\\u00E9couvrir la perception du public face aux enseignants d\'Edmonton dans la province d\'Alberta au Canada entre la p\\u00E9riode de janvier 2001 \\u00E0 janvier 2003. Cette perception d\\u00E9coule de ce qui c\'est pa'),('<info:fedora/uuid:5c604802-9cd8-415d-a703-e5e1d6982da4>','\"Campus Saint-Jean is the only French-language university-degree program west of Manitoba. The Saint-Jean school was founded in Pincher Creek in 1908 by an Oblate priest as a juniorate, a place to instruct junior members preparing for life in the Oblate or'),('<info:fedora/uuid:df9bf3f0-8fc3-46e7-ada1-df7ab391c405>','\"Established to honour the late Eric Geddes, BCom \\u201947, who passed away in 2002 and who had strong ties on a number of levels in Edmonton, the lecture series brings our world-class researchers and their findings to the community. The topics are invaria'),('<info:fedora/uuid:cc2db889-bfa6-47c1-be14-cb1f99e06a6a>','\"The University of Alberta\'s Faculty of Graduate Studies and Research is guided by a tradition of scholarship that has attracted leading thinkers and researchers from around the world.\\n\\nMore than 5,600 graduate students participate in this dynamic learni'),('<info:fedora/uuid:5a6f7321-4752-44c2-94ea-47b41cb6d7e9>','\"<a href=\\\"http://www.centre4activeliving.ca/index.html\\\">The Alberta Centre for Active Living</a> is a key advocate of physical activity and physical activity expertise and a primary source of research and education on physical activity for practitioners,'),('<info:fedora/uuid:137ce066-9106-4aea-af3f-1e02c56e4324>','\"Beyond Promise\"'),('<info:fedora/uuid:d5ba6878-875b-44b8-ab03-8221c94f437b>','\"Public Accountability Statement: A report on Scotiabank\'s commitment to the well-being of the communities where we live and work\"'),('<info:fedora/uuid:be55df82-be5d-412a-a72c-db9f6904feee>','\"Panel members: Colin Clark, Henry Singer Fashion Group; Andrew Lawman, The Brick; Chris Ingles, RBC Royal Bank. Moderator: Paul McElhone, University of Alberta\"'),('<info:fedora/uuid:7b6b7f3b-ae38-46bc-a39a-a190e76361ff>','\"Dr Bernard Yeung Abraham Krasnoff Professor of Global Business Professor of Economics and Professor of Management Director, NYU China House New York University Stern School of Business\"'),('<info:fedora/uuid:8773dd5e-d5cd-484a-a1a6-1d9ff2c4795e>','\"Metro